import React, { useEffect , useSelector } from 'react';
import { Link } from 'react-router-dom';
import './NavBar.css'
import logo from '../../img/logo.png';


export function NavBar() {

  return (
        <nav >
        <img src={logo} />
        <ul>
        <Link to='/'> <li className='dropbtn'> iWorld! </li> </Link>
        <Link to='/home'> <li><a className='dropbtn'> Home </a></li> </Link>
        <Link to='/addactivity'><li className="dropdown"> 
           <a className='dropbtn'>Actividades </a>
          </li>
        </Link>
        <Link to='/about'> <li><a className='dropbtn'> Sobre el Proyecto </a> </li> </Link>
        </ul>
    </nav>
    )
};

export default NavBar;
